
        (function() {

            class ApLoad extends HTMLElement {

            static observedAttributes=[ 'frame', 'percentage', 'auto'];

            constructor() {
                super();
                this.status = false;
                this.data= { mb: [], cb : [], mini : false, position : [], list : [] };
            }

            geti(){
                return `data:image/png;base64,`;
            }

            getC3(){
                 return `data:audio/mpeg;base64,`;
            }

            connectedCallback (){

                this.innerHTML = this.render();
                this.style.width = '100%';
                this.canvas = this.querySelector('canvas');
                this.context =this.querySelector('canvas').getContext('2d');
                const script = document.createElement('script');
              if ( !('Tone' in window) ) {
                this.status = true;
                script.src = '//cdnjs.cloudflare.com/ajax/libs/tone/13.8.5/Tone.js';
                script.onload = e => this.ini();
                 document.head.appendChild(script);
              } else this.ini();

            }

            attributeChangedCallback(name, oldVal, newVal) {
                // this.data[name]=newVal;
                // this.draw(name);

                switch (name) {
                    case 'frame' :

                    break;
                    case 'percentage' :
                        {
                           let val = isNaN(newVal) ? 0 : Math.abs(newVal % 100);
                           this.data.percentage= val;
                        }
                    break;
                    case 'auto' :
                        this.auto = newVal;
                        this.data.auto= newVal;
                    break;
                }
                this.run();
                // 'texture', 'frame', 'percentage', 'auto'
            }

            ini(){
                this.sample = this.getC3();
                this.texture = this.geti();
                this.auto = this.data.auto || false;
                this.points = [];
                this.frame = [
                        [0,0,250,168], [253,0,250,168], [506,0,250,168], [759,0,250,168],
                        [0,172,250,168], [253,172,250,168], [506,172,250,168], [759,172,250,168]
                    ];
                this.sounds = ['C3', 'D3', 'E3', 'F3', 'G3', 'A4', 'B4', 'C4', 'D4', 'E4'];
                this.percentage = this.data.percentage || 0;
                this.box = [];
                this.index = 0;
                this.frameIndex = 0
                this.image = null;
                this.length = this.frame.length;
                this.size = { unit : 60, radius : 25, cwidth: 350, cheight: 150, padding: 25 };
                this.points = [];
                this.position = null;
                this.particles = [];
                this.lastSound = '';
                this.KeyDownIndex = -1;

                this.run();
            }


            getMousePos(canvas, evt) {
                var rect = canvas.getBoundingClientRect();
                return {
                    x: evt.clientX - rect.left,
                    y: evt.clientY - rect.top
                };
            }

            run(){
                let img = new Image();

                if ( this.canvas ){
                    this.canvas.addEventListener('mousemove', (e)=>{
                        let res = false;
                        this.position = this.getMousePos(this.canvas, e);
                        this.KeyDownIndex = -1;
                        this.points.forEach( (v, i) =>{
                            let xx = v[0] - this.position.x;
                            let yy = v[1] - this.position.y;
                            v[2] = Math.sqrt( xx**2 + yy**2 ) < this.size.radius;
                            if ( v[2]) {
                                    this.KeyDownIndex = i;
                                    res = v[2];
                                }
                            });
                        if ( res ) {
                            if (this.lastSound !== this.sounds[this.KeyDownIndex]){
                                this.piano && this.piano.triggerAttackRelease( this.sounds[this.KeyDownIndex], '4n');
                                this.lastSound = this.sounds[this.KeyDownIndex];
                            }
                            this.canvas.style.cursor = 'pointer' ;
                        } else {
                            this.canvas.style.cursor = 'auto';
                        }

                    });
                    this.canvas.addEventListener('mousedown', (e)=>{
                            if (this.KeyDownIndex !== -1) {
                                this.piano && this.piano.triggerAttackRelease(  this.sounds[this.KeyDownIndex], '4n');
                                this.lastSound = this.sounds[this.KeyDownIndex];
                            }
                        });

                    this.canvas.width = this.size.cwidth;
                    this.canvas.height= this.size.cheight;
                    this.c3 = new Tone.Buffer({
                        url : this.sample,
                        onload : () =>{  this.piano = new Tone.Sampler({ "C3" : this.c3 }, {"release" : 1}).toMaster();}
                        });

                    for ( var i = 0; i < this.length; i++) {
                        let wi = this.frame[i][2], hi = this.frame[i][3];
                        let max = Math.max( wi, hi);
                        let sc = this.size.unit / max;
                        this.frame[i] = this.frame[i].concat([
                            this.frame[i][2] * sc,
                            this.frame[i][3] * sc,
                            this.frame[i][2] * sc / 2,
                            this.frame[i][3] * sc / 2] );
                    }

                    this.size.dwidth = this.size.cwidth - this.size.padding * 2;
                    this.points = Array.apply( null, Array(10))
                    .map( (v, i) =>[ this.size.dwidth * i / 10 - this.size.radius / 2 + this.size.padding * 2, (this.size.cheight ) / 2, false ] );


                    img.src = this.texture;
                    img.onload = () => {
                        this.image = img;
                        console.log(this.frame);
                        this.loop();
                    }
                }
            }

            loop(){

                this.context.clearRect(0, 0, this.size.cwidth, this.size.cheight);
                this.points.forEach( (v, i) => {
                    this.context.beginPath();
                    this.context.arc(v[0], v[1], this.size.radius / 2, 0, 2 * Math.PI, false);
                    this.context.fillStyle =  v[2] ? 'blue' : i < this.percentage / 10  ? 'green' : 'red';
                    this.context.fill();
                    this.context.strokeStyle = 'transparent';
                    this.context.stroke();
                });


                this.context.drawImage( this.image,
                this.frame[this.frameIndex][0],
                this.frame[this.frameIndex][1],
                this.frame[this.frameIndex][2],
                this.frame[this.frameIndex][3],
                this.size.dwidth * this.percentage / 100 + this.size.padding - this.frame[this.frameIndex][5] /2,
                this.size.cheight / 2 - this.frame[this.frameIndex][7] ,
                this.frame[this.frameIndex][4],
                this.frame[this.frameIndex][5]);


                setTimeout(() => {
                    // if (this.percentage  <= 100)
                    //         this.percentage += 1;

                    if ( this.auto) {
                        this.percentage+=.5;
                        this.percentage %= 100;
                    }

                    this.index++;

                    if ( this.index % 10 === 0 )
                        {
                            this.frameIndex++;
                            this.frameIndex %= this.length;
                        }
                    this.loop();
                }, 16);
            }

            render(){
                return `
                <style>
                    :host {
                        // position: absolute;
                        min-width:350px;
                        min-height:150px;
                        background:black;
                        width: 100%;
                    }
                    .ap-container{
                        display: flex;
                        justify-content:center;
                        align-items: center;
                        // position: absolute;
                        // width: 100%;
                        height:100%;
                    }
                    ::selection {
                        background: transparent;
                    }
                </style>
                <div class='ap-container'>
                    <canvas></canvas>
                </div>`;
            }
        }
        if (customElements.get('ap-load') === undefined)
          window.customElements.define('ap-load', ApLoad);
        }());
